webpackJsonp([0xc84bc92c99a6],{7108:function(e,t){e.exports={data:{post:{html:'<p>Despite my reservations about the release, I of course downloaded <a title="Firefox - Rediscover the web" href="http://www.mozilla.org/products/firefox/">Firefox 1.0</a> as soon as it was available. And lo and behold, the <a href="http://www.papascott.de/archives/2004/11/08/firefox-not-ready/">hesitation</a> on <a href="http://jsiwwe.jsjjeidnhwnnds.com/">bad hostnames</a> under Linux has been fixed (it passes the request to the proxy server immediately instead of waiting for a DNS lookup). </p>\n<p>I still don\'t get all gushy about a web browser though. It\'s just a tool.</p>',fields:{title:"One Point Oh",date:"09 Nov 2004",url:"https://papascott.de/2004-11-09-one-point-oh/"}}},pathContext:{slug:"/2004-11-09-one-point-oh/",prev:{fields:{title:"",date:"09 Nov 2004",slug:"/2004-11-09-deutsche-nationale-regierungsumsturzenstag/"}},next:{fields:{title:"Singles night at Wal-Mart in Germany",date:"10 Nov 2004",slug:"/2004-11-10-singles-night-at-walmart-in-germany/"}}}}}});
